import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Tela from "../components/Tela.css"
import Logo from "../components/imagens/quest_logo.png"

export default function Body_c() {
  return (
    <div>
      <Container className="mb-4 bg-light">
        <Row className="justify-content-md-center">
          <Col className="mt-4 titulo">
           <h2>Certficado de horas de atvidades complementares</h2>
          </Col>
        </Row>
        <Row>
            <Col>
            <p className=""> 
                Olha só o quanto você acumulou de horas complementares ao ajudar 
                a pesquisa acadêmica!
            </p>
            </Col>
        </Row>
      </Container>
    </div>
  );
}
